import React from "react";

function Home() {
  return (
    <section>
      <div class="container-fluid">
        <h1 class="mt-5">Welcome to our CSC436 Database Project</h1>
        <p>This project was created using Node JS with React and MySQL</p>
      </div>
    </section>
  );
}

export default Home;
